import os
def download_file(url, folder):
    try:
        response = requests.get(url)
        response.raise_for_status()
        filename = os.path.join(folder, url.split('/')[-1])
        with open(filename, 'wb') as f:
            f.write(response.content)
        print(f"Файл сохранен: {filename}")
    except requests.exceptions.HTTPError as http_err:
        print(f"{url}: {http_err}")
    except Exception as err:
        print(f"{url}: {err}")

download_folder = 'downloaded_documents'
os.makedirs(download_folder, exist_ok=True)

for link in all_links:
    full_url = f'https://hse.ru{link}'
    print(f"Обрабатываем ссылку: {full_url}")
    try:
        response = requests.get(full_url)
        response.raise_for_status()
        soup = BeautifulSoup(response.text, 'html.parser')
        button_links = soup.find_all('a', class_='button button_large button_blue')
        for button in button_links:
            document_url = button.get('href')
            if document_url:
                if not document_url.startswith('http'):
                    document_url = f'https://hse.ru{document_url}'
                download_file(document_url, download_folder)

    except requests.exceptions.HTTPError as http_err:
        print(f"{full_url}: {http_err}")
    except Exception as err:
        print(f"{full_url}: {err}")

