import zipfile
from docx import Document
import io

def extract_archive_and_split_by_paragraphs(archive_path):
    result = []

    with zipfile.ZipFile(archive_path, 'r') as archive:
        for file_name in archive.namelist():
            if not file_name.endswith('.docx'):
                continue  # Пропускаем файлы, не являющиеся .docx

            document_data = archive.read(file_name)
            doc = Document(io.BytesIO(document_data))  # Используем BytesIO для передачи байтового потока
            paragraphs = [paragraph.text.strip() for paragraph in doc.paragraphs]
            result.append(paragraphs)

    return result

# Пример использования функции
