from sentence_transformers import SentenceTransformer
import faiss

# Загружаем модель (энкодер Трансформера для формирования векторного пространства)
model = SentenceTransformer('all-MiniLM-L6-v2')

# Кодируем список текстов (строк) из переменной cleaned_text с помощью SentenceTransformer
embeddings = model.encode(cleaned_text, convert_to_numpy=True)

# Создаем индекс FAISS (это модель для эмбеддингов)
dim = embeddings.shape[1]  # Рассчитываем размерность матрицы эмбеддингов
index = faiss.IndexFlatIP(dim)  # Создаем пустую векторную БД нужной размерности dim

# Добавляем embeddings в FAISS index
index.add(embeddings)

"""*   Пробуем на простом вопросе"""

# Делаем запрос к БД: кодируем текущий запрос пользователя
text = "Что делать при отчислении?"  # Замените на ваш текст запроса
embedding = model.encode([text], convert_to_numpy=True)

# Производим поиск по БД, ищем k ближайших по вектору документов
D, I = index.search(embedding, k=1)  # Замените index_fever на index

# Здесь будет ближайшее по вектору совпадение
extracted_sample = cleaned_text[I[0][0]]  # Извлекаем текст документа по индексу

print("Найденный документ:", extracted_sample)

"""*   Функция для извлечения лучшей информации на основе запроса


"""

def answer_information(text):

      embedding = model.encode([text], convert_to_numpy=True)
      D, I = index.search(embedding, k=1)
      info = '. '.join(cleaned_text[I[0][0]])

      return info

