client = InferenceClient(model_name, token='token') # Вместо token вставляется токен с HF

import json

# Создание функции для запросов к модели
def llm_inference(request, help_information):
  output = client.chat.completions.create(
          # Промпты
          messages=[
              # Основная системная инструкция
              {"role": "system", "content": "Ты - помощник студента в адаптации в университете. Ответь на вопрос. Не объясняй свои рассуждения"},
              # request - запрос пользователя в виде переменной
              # help_information - наилучшая информация по вопросу из наших файлов
              {"role": "user",
              "content": f"Я студент. Вот мой вопрос: {request}. Кратко сформулируй ответ на него, используя информацию: {help_information}."},
          ],
          response_format={
           "type": "json",
           "value": {"properties": {"ответ": {"type": "string"}}},
           "required": ["concept_name", "concept_description"]
           },

          stream=False,
          max_tokens=750, # Максимальная длина вывода
          temperature=0.8, # Температура
          top_p=0.1 # Объем выборки для сэмплирования
          )
  # Вывод текста, ответа модели
  return output.choices[0].get('message')['content']

import re

# Функция для приведения выдачи модели к нужному виду (отчистка от лишних знаков)

def clean_response(response: str) -> str:
    match = re.match(r'^\{"ответ":"(.*)"\}$', response)
    return match.group(1) if match else response  # Извлекаем содержимое, если найдено совпадение

"""

*   Создаем функцию для получения ответа при помощи ИИ на оснвое сообщения

"""

def get_answer_api(message):
    answer = clean_response(str(llm_inference(message, answer_information(message))))
    return answer

